package com.rison.traffic.Application

import cn.hutool.core.date.DateUtil
import com.rison.traffic.util.{DateUtils, SparkUtils}
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.internal.Logging
import org.apache.spark.rdd.RDD
import org.apache.spark.{SparkConf, SparkContext}
import scala.collection.mutable.ListBuffer
import scala.util.Random


/**
 * @author : Rison 2021/9/29 下午3:34
 *         7. 随机抽取车辆
 *         假设一天的车流量是10000，在7~8点之间车流量为2000，
 *         在13~14点车流量是3000，那么我们想要在一天中随机抽取100辆车辆信息，
 *         那么，应该在7~8点抽取2000/10000*100=20辆，在13~14点之间抽取3000/10000*100=30辆
 */
object RandomExtractCarApplication extends Logging{
  //一共抽取500辆,总数据车辆数为3632，这里不能大于总的车辆数
  val extractCarNum = 500

  def main(args: Array[String]): Unit = {
    val sparkConf = new SparkConf()
    sparkConf.setAppName(this.getClass.getSimpleName.stripSuffix("$"))
    SparkUtils.setMaster(sparkConf)
    val sc: SparkContext = SparkContext.getOrCreate(sparkConf)

    //获取全部的卡扣车流量数据
    val monitorCarFlowRDD: RDD[String] = sc.textFile("data/monitor_flow_action")
    //过车数据基本信息(monitorId, carId, time)
    val baseRDD: RDD[(String, String, String)] = monitorCarFlowRDD
      .flatMap(
        data => (data.split("\n"))
      )
      .map(
        line => {
          val strings: Array[String] = line.split("\t")
          (strings(1), strings(3), strings(4))
        }
      )
    baseRDD.cache()

    //将日期转换为小时，并过滤去重(hour, carId)
    val hourCarRDD: RDD[(Int, String)] = baseRDD.map(
      data => {
        val hour: Int = DateUtil.hour(DateUtils.getTimeStringToDate(data._3), true)
        (hour, data._2)
      }
    )
      .distinct()
    //每小时对应的过车总数目(hour, count)
    val hourCountMap: collection.Map[Int, Long] = hourCarRDD.countByKey()
    //全部过车数目
    val total: Long = hourCountMap.toList.toStream.map(_._2).sum

    if (extractCarNum >= total){
      logError("===============抽取的车辆数不能大于总的车辆数，请减少抽取车辆数！==================")
      throw new Exception()
    }

    //每小时应该抽取的车辆数据（hour, eCount）
    val hourExtractNumMap: collection.Map[Int, Int] = hourCountMap.map(
      data => {
        //这里记得要转为Double类型，否则会被认为Int计算
        (data._1, (data._2.toDouble / total * extractCarNum).toInt)
      }
    )
    //广播变量
    val hourExtractCountBC: Broadcast[collection.Map[Int, Int]] = sc.broadcast(hourExtractNumMap)

    //另一个分支，统计每个小时对应的全部CarId集合 (hour, carIds)
    val hourCarsRDD: RDD[(Int, Iterable[String])] = hourCarRDD.groupByKey()
    //抽取到的车辆集合
    val extractCarsRDD: RDD[String] = hourCarsRDD
      .flatMap(
        data => {
          val list: List[String] = data._2.toList
          //应该抽取的车辆数量
          val num = hourExtractCountBC.value.getOrElse(data._1, 0)
          //随机抽取
          val bufferCar: ListBuffer[String] = ListBuffer()
          val bufferIndex: ListBuffer[Int] = ListBuffer()
          for (a <- 0 until num) {
            var i: Int = new Random().nextInt(list.size)
            while (bufferIndex.contains(i)) {
              i = new Random().nextInt(list.size)
            }
            bufferIndex.append(i)
            bufferCar.append(list(i))
          }
          bufferCar.toList
        }
      )

    val extractCars: Array[String] = extractCarsRDD.collect()
    //广播抽到的cars
    val extractCarsBC: Broadcast[Array[String]] = sc.broadcast(extractCars)

    val carTrackRDD: RDD[(String, String)] = baseRDD.filter(
      data => {
        extractCarsBC.value.toList.contains(data._2)
      }
    )
      .map(data => (data._2, (data._1, data._3)))
      .groupByKey()
      .map(
        data => {
          val track: String = data._2.toList.sortWith((x, y) => DateUtils.getTimeStringToLong(x._2) < DateUtils.getTimeStringToLong(y._2))
            .toStream.map(_._1).toList.mkString("->")
          (data._1, track)
        }
      )

    carTrackRDD.collect().foreach(println)


    baseRDD.unpersist()
    sc.stop()
  }

}
